<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Certify Recruit Certificate</title>
    <style>
        @page {
            /* size: 7in 9.25in; */
            margin: 0;
        }

        body {
            /* overflow: hidden; */
            font-size: 18px;
            font-family: 'Gill Sans', 'Gill Sans MT', Calibri, 'Trebuchet MS', sans-serif;
            margin-top: 35px;
            margin-bottom: 30px;
            margin-left: 30px;
            margin-right: 30px;
        }

        .certificate_inner {
            border-radius: 18px;
            border: 1px solid #E3E3E3;
            padding: 35px 28px 10px 27px;
        }

        .certificate_inner h1 {
            margin: 0;
            color: #013BB7;
            font-family: Cambria, Cochin, Georgia, Times, 'Times New Roman', serif;
            font-weight: 700;
            font-size: 34px;
            text-align: center;
        }

        .logo {
            text-align: center;

        }

        .logo img {
            max-width: 300px;
            max-height: 150px;
        }

        .certificate_name {
            text-align: center;
            font-family: monospace;
            font-weight: lighter;
            color: #013BB7;
            font-size: 32px;
        }

        .presents {
            padding-top: 80px;
        }

        .input_name {
            padding-top: 40px;
            max-width: 80vw;
            border-bottom: 1px solid #DCDCDC;
            max-width: 430px;
        }

        .input_name h1 {
            text-align: left;
        }

        .text_below {
            padding-top: 30px;
            max-width: 430px;
        }

        .sign_text {
            margin-top: 6px;
        }

        .sign_text p {
            font-size: 12px !important;
        }

        .text_below p {
            font-family: 'Gill Sans', 'Gill Sans MT', Calibri, 'Trebuchet MS', sans-serif;
        }

        p {
            margin: 0;
        }

        .value_text {
            padding-bottom: 10px;
        }

        .grade {
            padding-top: 30px;
            font-size: 15px;
            display: inline-block;
            
        }
        
        .grade_title {
            line-height:35px;
            margin-bottom:3px;
        }

        .grade p {
            display: inline-block;
        }

        .grade .value_text {
            border-radius: 76px;
            background: #EEF4FF;
            width: 132px;
            height: 35px;
            font-weight: 700;
            margin-left: 10px;
            padding-bottom: 0;
            color: #013BB7;
            text-align: center;
            font-size: 15px;
            margin-top: 5px;
        }

        .grade .value_text span {
            padding-top: 9px;
            display: inline-block;
        }

        .sign {
            padding-top: 30px;
        }

        .sign_image {
            display: inline-block;
            border-bottom: 1px solid #DCDCDC;
            padding: 0 35px;
        }

        .sign_image img {
            max-width: 120px;
            text-align: center;
        }

        .sign p {
            display: inline-block;
        }

        .certi_title {
            width: 100%;
            font-size: 0;
            margin-bottom: 30px;
        }

        .cert_date,
        .logo,
        .cert_image {
            width: 33.33%;
            display: inline-block;
            vertical-align: inherit;
        }

        .certificate_block {
            display: inline-block;
            font-size: 0;
            width: 100%;
            padding-top: 25px;
            height: 60%;
        }

        .cert_image {
            text-align: right;
        }

        .certificate_left {
            width: 50%;
            display: inline-block;
        }

        .certificate_left p,
        .cert_date p {
            font-size: 18px;
        }

        .certificate_right {
            width: 50%;
            text-align: right;
            display: inline-block;
        }

        .certificate_right img {
            width: 90%;
        }
    </style>
</head>
<body>
    <div class="certificate">
        <div class="container">
            <div class="certificate_inner">
                <div class="certi_title">
                    <div class="cert_date">
                    <p>{{$data['completion_date']}}</p>
                    </div>
                    <div class="logo">
                        <img src="data:image/png;base64,">
                    </div>

                    <div class="cert_image">
                        <img src="data:image/png;base64,">
                    </div>
                </div>

                <div class="certificate_name">
                    <span><img src="data:image/png;base64," /> </span>
                    <h1>{{ strtoupper($data['recruitment_type']) }} RECRUITMENT ASSESSMENT</h1>
                </div>

                <div class="certificate_block">
                    <div class="certificate_left">

                        <div class="presents">
                            <p>Presented to:</p>
                        </div>
                        <div class="input_name">
                            <h1 class="value_text">{{ ucwords($data['user_name']) }}</h1>
                        </div>
                        <div class="text_below">
                            <p>We take great pleasure in presenting you with this certificate, acknowledging your outstanding achievement in successfully completing the {{ $data['recruitment_type'] }} recruitment assessment.</p>
                        </div>
                        <div class="grade">
                            <p class="grade_title">Grade Achieved:</p>
                            <p class="value_text"><span> {{$data['percentage']}}%</span></p>
                        </div>
                        <div class="sign">
                            <div class="sign_image">
                                <img src="data:image/png;base64,">
                            </div>
                            <div class="sign_text">
                                <p>Founder & CEO</p><br />
                                <p>CLUSTER CERTIFY RECRUIT PRIVATELIMITED</p>
                            </div>
                        </div>
                    </div>
                    <div class="certificate_right">
                        <img src="data:image/png;base64,">
                    </div>
                </div>


            </div>
        </div>
    </div>
</body>

</html>